def conv(fn):
    with open(f'{fn.replace(".bdg", "")}.png', "wb") as new:
        size = os.stat(fn).st_size
        pt = size & 4095
        with open(fn, "rb") as f:
            start = f.read(16)
            hsize = int.from_bytes(f.read(4), byteorder="little")-4
            f.read(hsize)
            byte = f.read(1)
            while byte:
                num = int.from_bytes(byte, "big")

                num ^= BDGAngoTbl[pt & 4095]
                num = num & 0xFF
                pt += 1

                new.write(num.to_bytes(1, "big"))
                byte = f.read(1)


